var express = require('express')
var router = express.Router()

var fakePhotos = []
fakePhotos.push(
    {
        name: 'node logo',
        path: "data:image/jpeg;base64,"
    }
)
fakePhotos.push(
    {
        name: 'node logo2',
        path: 'data:image/jpeg;base64,'
    }
)

list = (req, res) => {
    //实质上res.render用来渲染模板文件,和view做交互
    res.render('photos', {
        title: "photos",
        photos: fakePhotos
    })
}

router.get('/', list)

module.exports = router